  `dueno_id` int DEFAULT NULL,
  `tipo_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `zona_id` (`zona_id`),
  KEY `sector_id` (`sector_id`),
  KEY `obs_id` (`obs_id`),
  KEY `fk_dueno` (`dueno_id`),
