  CONSTRAINT `farmacia_ibfk_1` FOREIGN KEY (`zona_id`) REFERENCES `zona` (`id`),
  CONSTRAINT `farmacia_ibfk_4` FOREIGN KEY (`sector_id`) REFERENCES `sector` (`id`),
