  CONSTRAINT `fk_dueno` FOREIGN KEY (`dueno_id`) REFERENCES `dueno` (`id`),
  CONSTRAINT `fk_tipo` FOREIGN KEY (`tipo_id`) REFERENCES `categoria` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
